, Chocolate what's not to love , outrageously delicious BANOFFEE PIE!!!

@biggerbolderbaking

RECIPE : 

Graham crackers - 250 gms
Melted butter - 
Bananas - 2-3
Dulce de leche - 1 can
Whipping cream - 1 cup
Powdered sugar - 2 tsp
Chocolate shavings for sprinkling

Method :

1. Powder the Graham crackers ( I used homemade crackers ) in a blender , add butter and combine well (mixture will be like wet sand).

2. Spread this mixture evenly across a pie dish and chill for 15 minutes

3. Assemble the sliced bananas evenly and add the dulce de leche (or) the reverse order.

4. Add the sugar and whip the cream till stiff peaks .Add dollops of the whipped cream onto the pie .

5.Grate some chocolate and serve !!!

